window.bookSummaryJSON = "<p>Mary Robinette Kowal returns to Mars in this latest entry to the Hugo and Nebula Award-winning Lady Astronaut series.</p> <p>Years after a meteorite strike obliterated Washington, DC—triggering an extinction-level global-warming event—Earth’s survivors have started an international effort to establish homes on space stations and the Moon.</p> <p>The next step–Mars.</p> <p>Elma York, the Lady Astronaut, lands on the Red Planet, optimistic about preparing for the first true wave of inhabitants. The mission objective is more than just building the infrastructure of a habitat–they are trying to preserve the many cultures and nuances of life on Earth without importing the hate.</p> <p>But from the moment she arrives, something is off.</p> <p>Disturbing signs hint at a hidden disaster during the First Mars Expedition that never made it into the official transcript. As Elma and her crew try to investigate, they face a wall of silence and obfuscation. Their attempts to build a thriving Martian community grind to a halt.</p> <p>What you don’t know <i>can </i>harm you. And if the truth doesn’t come to light, the ripple effects could leave humanity stranded on a dying Earth ...</p> <ul> <li><i>Lady Astronaut</i></li> <li><i>The Calculating Stars</i></li> <li><i>The Fated Sky</i></li> <li><i>The Relentless Moon</i></li> <li><i>The Martian Contingency</i></li> </ul>"; 
